  //   })
console.log('THIS IS WORKING')
  axios
  .get('/users')
  .then( usernames => {
    console.log("usernames", usernames)
    this.setState({usernames: usernames.data})
  })
  .catch( err => {
    console.log('err', err)
  })
}

/* Helpers */  
thePriority(props) {
  let priorityVar = props.priority_id;

  if (priorityVar === 111) {
    return "Low"
  } else if (priorityVar === 555) {
      return "Medium"
    } else if (priorityVar === 999) {
        return "High"
      }
}

theStatus(props) {
  let statusVar = props.status_id;

  if (statusVar === 10) {
    return "Queue"
  } else if (statusVar === 50) {
      return "In Progress"
    } else if (statusVar === 90) {
        return "Done"
      }
}

userCreatedAssigned(props) {
  let userVar = props.user_id;

  if (userVar === props.created_by || props.assigned_to) {
    return props.first_name && ' ' && props.last_name
  } 
}


/* End Helpers */

}



export default Help;
